import React from 'react';
import { Navbar, Nav } from 'react-bootstrap';


const Header = () => {
  return (
    <Navbar bg="light" expand="lg">
      <h1>Header</h1>
      <h4>About, Contact, Portfolio Projects, Experience, Education, Resume</h4>
    </Navbar>
  );
}

export default Header
